import React from "react";
import "./Jumbotron.css";

const Jumbotron = () => (
	<header className = "jumbotron">
		<h1>Kansas City Chiefs Clicky Game!</h1>
		<h3>Click on any image to earn a point, but don't click on the same picture more than once. Click all 12 pictures to win the game!</h3>
	</header>
);
export default Jumbotron;
